import React, { Component } from 'react';
class ListOfProjects extends Component {
    render() {
        return (
            <div className="foto">
                    <img src={this.props.photo} thumbnail responsive/>
                    <p>{this.props.text}</p>
            </div>
        );
    }
}

export default ListOfProjects;
